<template>
    <div>
         <vue-good-table
                :columns="columns"
                :rows="products"
                class="table"
        ></vue-good-table>
        <b-form inline>
              <label class="sr-only" for="inline-form-input-name">Name</label>

              <b-form-input
                  v-model="id"
                  id="inline-form-input-name"
                  class="mb-2 mr-sm-2 mb-sm-0"
                  placeholder="ID"
              ></b-form-input>

              <b-form-input
                  v-model="name"
                  id="inline-form-input-name"
                  class="mb-2 mr-sm-2 mb-sm-0"
                  placeholder="Название"
              ></b-form-input>

              <b-form-input
                  v-model="article"
                  id="inline-form-input-name"
                  class="mb-2 mr-sm-2 mb-sm-0"
                  placeholder="Артикул"
              ></b-form-input>

              <b-form-input
                  v-model="count"
                  id="inline-form-input-name"
                  class="mb-2 mr-sm-2 mb-sm-0"
                  placeholder="Количество"
              ></b-form-input>

              <b-form-input
                  v-model="price"
                  id="inline-form-input-name"
                  class="mb-2 mr-sm-2 mb-sm-0"
                  placeholder="Цена"
              ></b-form-input>

              <b-button variant="primary" @click="addProduct">Добавить</b-button>
              <b-button variant="primary" @click="updateProduct">Обновить</b-button>
              <b-button variant="primary" @click="deleteProduct">Удалить</b-button>
              <b-button pill variant="secondary" @click="getJSON">Выгрузить в формате .JSON</b-button>
              <b-button pill variant="secondary" @click="generatePDF">Выгрузить в формате .PDF</b-button>
        </b-form>
        <p></p>
        <b-form-file
            accept=".json"
            v-model="file"
            :state="Boolean(file)"
        ></b-form-file>
        <b-button pill variant="secondary" @click="addJSON">Звгрузить файл в формате .JSON</b-button>
        <b-alert>
              <p>{{ alertText }}</p>
        </b-alert>
    </div>
</template>

<script>
    import {url} from "@/main";
    import jsPDF from 'jspdf'
    export default {
      name: 'ProductsView',
      data() {
        return {
          file: null,
          id: null,
          name: '',
          article: '',
          count: null,
          price: null,
          alertText: "Ошибка!",

          columns: [
            {
              label: 'ID',
              field: 'id'
            },
            {
              label: 'Название',
              field: 'name',
            },
            {
              label: 'Артикул',
              field: 'article',
            },
            {
              label: 'Количество',
              field: 'count',
              type: 'number',
            },
            {
              label: 'Стоимость',
              field: 'price',
              type: 'number',
            },
          ],
          products: [],
        }
      },
      created() {
          this.getData()
          //this.rows = this.drivers
        },
        methods: {
          getData() {
            this.$http.get(url + "/product")
                .then(response => {
                  const products = response && response.data ? response.data : []
                  this.products = products.map(r => {
                    return {
                      id: r.id,
                      name: r.name,
                      article: r.article,
                      count: r.count,
                      price: r.price
                    }
                  })
                })
          },
          createData() {
            this.$http.post(url + "/product", {
              name: this.name,
              article: this.article,
              count: this.count,
              price: this.price,
            }).catch(() => {
              this.alertText = "Ошибка!"
            }).then(() => this.getData())
          },
          updateData() {
            this.$http.put(url + "/product/" + this.id.toString(), {
                  id: this.id,
                  name: this.name,
                  article: this.article,
                  count: this.count,
                  price: this.price,
                }
            ).catch((e) => {
              console.log(e.toString())
              this.alertText = "Ошибка!"
            }).then(() => this.getData())
          },
          deleteData() {
            this.$http.delete(url + "/product/" + this.id.toString()).catch((e) => {
              if (e.response.status === 404) {
                this.alertText = "Не найдено!"
                console.log("Error 404. Driver not found. WebApp. " + e.toString())
              } else {
                this.alertText = "Ошибка!"
                console.log("Error. WebApp. " + e.toString())
              }
            }).then(() => this.getData())
          },
          countDownChanged(dismissCountDown) {
            this.dismissCountDown = dismissCountDown
          },
          showAlert(text) {
            this.alertText = text
          },
          addProduct() {
            this.createData()
            this.showAlert("Добавлено!")
          },
          deleteProduct() {
            this.deleteData()
            this.showAlert("Удалено!")
          },
          updateProduct() {
            this.updateData()
            this.showAlert("Обновлено!")
          },
          getJSON() {
                var fileDownload = require('js-file-download');
                fileDownload(JSON.stringify(this.products), 'products.json');
          },
          addJSON() {
            let reader = new FileReader()
            reader.readAsText(this.file)
            reader.onload = () => {
              let data = JSON.parse(reader.result) // [{},{}]
              this.$http.post(url + "/product/list", data).catch(() => {
                this.alertText = "Ошибка!"
              }).then(() => this.getData())
            }
          },
          generatePDF() {
                const pdf = new jsPDF()
                console.log(pdf.getFontList())
                const myFont = ''; // load the *.ttf font file as binary string

          // add the font to jsPDF
                pdf.addFileToVFS("MyFont.ttf", myFont);
                pdf.addFont("MyFont.ttf", "MyFont", "normal");
                pdf.setFont("MyFont");
                let text = "Продукты\n\n";
                for (let i = 0; i < this.products.length; i++) {
                  text +="ID: " +
                  this.products[i].id + "\nНазвание: " + this.products[i].name + "\nАртикул: " + this.products[i].article + "\nКоличество: " + this.products[i].count + "\nСтоимость: " + this.products[i].price + "\n\n"
                }
                pdf.text(text, 10, 10)
                pdf.save("products.pdf")
              }

        },
      };
</script>

